function App() {
    return (
      <Router>
        <div className="App">
          <Sidebar />
          <Routes>
            <Route path="/estoque" element={<Estoque />} />
            {/* Outras rotas e componentes */}
          </Routes>
        </div>
      </Router>
    );
  }

export default App;
